window.bookSummaryJSON = "<p><b>He hates to want her. She wants to hate him. </b></p> <p>Remi Tanner wasn’t part of the plan. But when I see my uncle doting on her, I know she’s going to help me destroy him. <i>I’ll taunt her. Test her. In the end, I’ll break her</i>.&nbsp;</p> <p>Ace Jagger wasn’t a good guy. But he swept into my life like a storm, and I’m caught up in the aftermath. <i>He’s cruel. Calculating. In the end, I never stood a chance. </i></p> <p>She might be a Sterling Prep princess, and I might be the guy from the wrong side of the tracks, but one thing's for sure...I won’t stop until I get what I want. Revenge.&nbsp;</p> <p>Taunt Her <i>is a dark high school bully romance. If possessive, tattooed, motorcycle-riding alphaholes aren't your thing, you probably won't like this book!</i></p>"; 
